cy.get(_selectors.default.cart.cartItem).then($items => {
  const actualCart = [];
  Cypress.$($items).each((_, item) => {
    const name = Cypress.$(item).find(_selectors.default.products.itemName).text().trim();
    actualCart.push(name);
  });
  expectedCart.forEach(product => {
